import React from 'react';
import { Navigate } from 'react-router-dom';

const ProtectedRoute = ({ Element, ...props }) => {
  console.log(props);
  return props.loggedIn ? <Element /> : <Navigate to="/sign-in" replace />;
};

export default ProtectedRoute;
